import './App.css';
import React from "react"
import Education from './Components/Skills';
import Experience from './Components/Experience';
import Intro from './Components/Intro';
import Navbar from './Components/Navbar';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Intro/>
      <Experience/> 
      <Education/>
    </div>
  );
}

export default App;
